import React from 'react';
import { BrowserRouter as Router, Route, Switch} from 'react-router-dom';
import Navbar from './components/Navbar';
import Header from './components/Header';
import Proyectos from './components/Proyectos';
import Tecnologias from './components/Tecnologias';
import SobreMi from './components/SobreMi';
import Contacto from './components/Contacto';
import './assets/css/styles.css'

function App() {
  return (
    <Router>
      <Navbar />
      <Switch>
          {/*<Route path="/proyectos" exact= {true} component={Proyectos}/>*/}
          {/*<Route path="/tecnologias" exact= {true} component={Tecnologias}/>*/}
          {/*<Route path="/sobremi" exact= {true} component={SobreMi}/>*/}
          <Route path="/contacto" exact= {true} component={Contacto}/>
      </Switch>
      <Header />
      <Proyectos/>
      <Tecnologias/>
      <SobreMi/>
    </Router>
  );
}

export default App;
